import { createTheme } from "@material-ui/core";

export const themes = createTheme({
    palette: {
        primary: {
            //dark lime
            bg2: '#397367',
            //bright lime
            bg1: '#63CCCA',
            //white
            text: '#FFFFFF',
        },
        secondary: {
            //greenish lime
            main: '#5DA399',
            //blueish lime
            temp:'#4285C',
        },
        background:{
            //gray
            main: '#35393C',
        }
    },
});
